import "./App.css";
import { ContentHomePage } from "./components/homePage/index.jsx";
import { useState } from "react";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const Login = () => {
    setIsLoggedIn(true);
  };

  const Logout = () => {
    setIsLoggedIn(false);
  };

  return (
    <main className="App App-header">
      <div className="content">
        <ContentHomePage setIsLoggedIn={setIsLoggedIn} />
      </div>

      <div className="logged"></div>
    </main>
  );
}

export default App;
